  input: '"TEXT","F3XA","C00165688","Contributions from Bank of America Corporation
    PAC and Emilys List have been correctly disclosed by us.    ASDC Partnership Program
    is a joint fundraising programs in which the North Carolina Democratic Party participates.   Transfers
    are made to the NCDP on an as-needed basis.  Please note that state party committees
    have been reporting Memo Entries on Schedule A for contributions received by the
    joint fundraising program during the reporting period in which the contribution
    was received irrespective of whether transfers have been made.  Memo Entries on
    Schedule A from these programs reflect the gross amounts raised while the transfers
    to the NCDP reflect the net amount distributed to date.  Accordingly, there will
    always be a difference between the transfer and the Memo Schedule A totals.  By
    prior agreement between the NCDPs counsel and the FEC, Memo Schedule As for these
    programs are reported on a quarterly basis.    The NCDP has used its best efforts
    as defined by the FEC to disclose the full identity of all individuals who contribute
    in excess of $200 in a calendar year.  In addition to requesting the information
    on the original solicitation, every 30 days the NCDP sends to all donors whose
    information is not complete a letter requesting the required information and includes
    a self-addressed stamped reply postcard.    Contributions received from individuals
    less than $200 are disclosed on Schedule A of this report because additional contributions
    from those individuals received and disclosed during the reporting period bring
    their total contributions for the year up to or exceeding the $200 threshold.    No
    disbursement disclosed on Schedule B Supporting Line 21 on this report referred
    to a clearly identified federal candidate or was made on behalf of a clearly identified
    federal candidate    Disbursements disclosed on Schedule B Supporting Line 21
    to individuals in excess of $500 have been clarified.  The payment to Marc Pruett
    ($650.00) was for a Musical Performance/Entertainment by him personally.  Payments
    to Mark Hufford (558.60) and Kristin Ward (484.75) were for mileage reimbursement.    No
    memo entries are itemized on Schedule B Supporting Line 21 for the office supply/shipping
    re-imbursement to Mark Hufford ($212.85) because none of the payments to the original
    vendor exceeded the $200 aggregate threshold required for itemization.    No disbursements
    disclosed on Schedule B Supporting Line 30b for FEA/Direct Mail, FEA/Newspaper
    Advertising, FEA/GOTV Radio, or FEA/Postage referred to clearly identified candidates
    for federal office.  They were for generic Democratic GOTV purposes.    All Payroll,
    Payroll Taxes, AFLCA Payroll,  Health Insurance, Payroll Pd to Seligman, and Supplemental
    Insurance disclosed on Schedule H4 are for employees who did NOT spend more than
    25% of their compensated time in a given month on Federal Election Activity (FEA)
    or activities in connection with a Federal election.    Disbursement s disclosed
    on Schedule H4 for Food/Catering and Catering were not on behalf of specifically
    identified federal candidates.    Payment(s) disclosed for Generic Advertising
    were for non-public communication, generic activity.    The purpose of the Co-Ordinated
    Expenditure disclosed on Schedule F to Natural Expressions was incorrectly described
    as Direct Mail on the 24-hour Report.  It is correctly described here as being
    for Door Hangers."'
